def encrypt(s):
    result = ""
    for char in s:
        if char.isalpha():
            shift = 2 * (ord(char.lower()) - ord('a'))
            encrypted_char = chr((ord(char) - ord('a') + shift) % 26 + ord('a'))
            result += encrypted_char
        else:
            result += char
    return result

