def compare_one(a, b):
    if type(a) == type(b):
        if a == b:
            return None
        elif a > b:
            return a
        else:
            return b
    elif isinstance(a, (int, float)) and isinstance(b, (int, float)):
        if float(str(a).replace(',', '.')) == b:
            return None
        elif float(str(a).replace(',', '.')) > b:
            return a
        else:
            return b
    elif isinstance(a, str) and isinstance(b, str):
        if float(a.replace(',', '.')) == float(b.replace(',', '.')):
            return None
        elif float(a.replace(',', '.')) > float(b.replace(',', '.')):
            return a
        else:
            return b
    elif isinstance(a, str) and isinstance(b, (int, float)):
        if float(a.replace(',', '.')) == b:
            return None
        elif float(a.replace(',', '.')) > b:
            return a
        else:
            return b
    elif isinstance(a, (int, float)) and isinstance(b, str):
        if a == float(b.replace(',', '.')):
            return None
        elif a > float(b.replace(',', '.')):
            return a
        else:
