            new_x, new_y = x + dx, y + dy
            if isValid(new_x, new_y) and not visited[new_x][new_y]:
                new_path = dfs(new_x, new_y, path + [grid[new_x][new_y]])
                if min_path is None or new_path < min_path:
                    min_path = new_path

        visited[x][y] = False
