def minPath(grid, k):
    n = len(grid)
    directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]

    def dfs(i, j, path):
        if len(path) == k:
            return path

        min_path = None
        for di, dj in directions:
            ni, nj = i + di, j + dj
            if 0 <= ni < n and 0 <= nj < n:
                new_path = dfs(ni, nj, path + [grid[ni][nj]])
                if min_path is None or new_path < min_path:
                    min_path = new_path

        return min_path

    min_val = float('inf')
    for i in range(n):
        for j in range(n):
            path = dfs(i, j, [grid[i][j]])
            if path < min_val:
                min_val = path

    return min_val

