def prod_signs(arr):
    if not arr:
        return None
    product = 1
    for num in arr:
        product *= 1 if num == 0 else num / abs(num)
    return sum(abs(num) for num in arr) * product

def tri(n):
    if n == 0:
        return [0]
    elif n == 1:
        return [1, 3]
    else:
        tribonacci = [0, 1, 3]
        for i in range(3, n + 1):
            if i % 2 == 0:
                tribonacci.append(1 + i // 2)
            else:
                tribonacci.append(tribonacci[i - 1] + tribonacci[i - 2] + tribonacci[i - 3])
        return tribonacci

def digits(n):
    result = 1
    for digit in str(n):
        if int(digit) % 2 != 0:
            result *= int(digit)
    return result if result != 1 else 0

