def largest_smallest_integers(lst):
    neg_integers = [num for num in lst if num < 0]
    pos_integers = [num for num in lst if num > 0]

    max_neg = max(neg_integers) if neg_integers else None
    min_pos = min(pos_integers) if pos_integers else None

    return (max_neg, min_pos)

def compare_one(a, b):
    if type(a) == type(b):
        if a > b:
            return a
        elif b > a:
            return b
        else:
            return None
    elif isinstance(a, (int, float)) and isinstance(b, (int, float)):
        if float(a) > float(b):
            return a
        elif float(b) > float(a):
            return b
        else:
            return None
    elif isinstance(a, str) and isinstance(b, str):
        a = a.replace(",", ".")
        b = b.replace(",", ".")
        if float(a) > float(b):
            return a
        elif float(b) > float(a):
            return b
        else:
            return None
    elif isinstance(a, str):
        a = a.replace(",", ".")
        if float(a) > b:
            return a
        elif b > float(a):
            return b
        else:
            return None
    else:
        b = b.replace(",", ".")
        if a > float(b):
            return a
        elif float(b) > a:
            return b
        else:
            return None

def special_factorial(n):
    result = 1
    for i in range(1, n+1):
        factorial = 1
        for j in range(1, i+1):
            factorial *= j
        result *= factorial
    return result

def fix_spaces(text):
    result = ""
    count = 0
    for char in text:
        if char == " ":
            count += 1
            if count > 2:
                result = result[:-1] + "-"
        else:
            count = 0
        if char != " ":
            result += char
        else:
            result += "_"
    return result

def file_name_check(file_name):
    if file_name.count('.') != 1:
        return 'No'
    name, ext = file_name.split('.')
    if len(name) == 0 or not name[0].isalpha():
        return 'No'
    if ext not in ['txt', 'exe', 'dll']:
        return 'No'
    if sum(1 for c in name if c.isdigit()) > 3:
        return 'No'
    return 'Yes'

def words_in_sentence(sentence):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n ** 0.5) + 1):
            if n % i == 0:
                return False
        return True

    words = sentence.split()
    prime_words = [word for word in words if is_prime(len(word))]
    return ' '.join(prime_words)

def simplify(x, n):
    x_num, x_den = map(int, x.split('/'))
    n_num, n_den = map(int, n.split('/'))
    result = x_num * n_num / (x_den * n_den)
    return result.is_integer()

def specialFilter(nums):
